import App, { Container } from 'next/app';
import cookie from 'cookie';
import userContext from '../userContext';

function MyApp({ Component, pageProps }) {
  return (
    <Container>

      <userContext.Provider>
        <Component {...pageProps} />
      </userContext.Provider>
    </Container>
  );
}

export default MyApp;
